import { cardsMock } from "./Configs";

export const getTagsSet = () => {
  const tagsSet = cardsMock.reduce((acc, { cardRows }) => {
    cardRows &&
      cardRows.length > 0 &&
      cardRows.map(({ cardTags }) =>
        cardTags.map(({ title }) => acc.add(title))
      );

    return acc;
  }, new Set());
  console.log("tagsSet :", tagsSet);
  return tagsSet;
};
